import { BrowserRouter, Route, Routes, Link } from "react-router-dom";
import User from "./components/users/User";

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<User />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
